❌ATENCIÓ❌ 
Etiqueta el teu refugi o associació d’animals preferit.
En breu començaré una pintura nova,però aquesta vegada serà molt especial perquè la intenció es vendre-la i els diners recaudats els donarem en un refugi d’animals de catalunya.Un cop acabat el quadre,estarà exposat al restaurant @elpetitvega de Camprodon.No serà fàcil ni rapid però i posarem tot el nostre empeny i amor per intentar ajudar ❤️‍🩹

